import React from 'react';
import styled from "@emotion/styled";

const KlarnaButton = styled.button`
  display: block;
  height: 40px;
  width: 100%;
  font-size: inherit;
  background-color: "#000000";
  border-radius: 4px;
  opacity: 0.5 : 1;
  color: black;
  font-color: white;
  font-weight: 600;
  cursor: pointer;
`;

export default KlarnaButton;
